css:
.github-RecentCommits {
  max-height: 109px;
  overflow-x: hidden;
  overflow-y: auto;
  border-top: 1px solid #313557;
}
.github-RecentCommits-list {
  margin: 0;
  padding: 7.5px 0;
  list-style: none;
}
.github-RecentCommits-message {
  padding: 7.5px 15px;
  text-align: center;
  color: #7278af;
}
.github-RecentCommit {
  position: relative;
  display: flex;
  align-items: center;
  padding: 0 15px;
  line-height: 31px;
}
.github-RecentCommit-authors {
  position: absolute;
  display: flex;
}
.github-RecentCommit-avatar {
  position: relative;
  margin-right: -13px;
  width: 16px;
  height: 16px;
  border-radius: 3px;
  color: transparent;
  background-color: #363952;
  box-shadow: 1px 0 #22253d;
  overflow: hidden;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-RecentCommit-avatar:nth-child(1) {
  z-index: 3;
}
.github-RecentCommit-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-RecentCommit-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-RecentCommit-avatar:nth-child(n+4) {
  display: none;
}
.github-RecentCommit-avatar:only-child,
.github-RecentCommit-avatar:last-child {
  box-shadow: none;
}
.github-RecentCommit-authors:hover .github-RecentCommit-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-RecentCommit-message {
  flex: 1;
  margin: 0 .5em;
  margin-left: 31px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.github-RecentCommit-undoButton.btn {
  padding: 0 10px;
  margin-right: 7.5px;
  height: 20px;
  line-height: 1;
  font-size: .9em;
}
.github-RecentCommit-time {
  color: #7278af;
}
.github-RecentCommit:hover {
  color: #bea8ce;
  background: #2b2f4d;
}
.github-RecentCommit.is-selected {
  color: #d3b1c0;
  background: #35395e;
}
.github-RecentCommits:focus .github-RecentCommit.is-selected {
  color: #ffffff;
  background: #4b5185;
}
@media (min-height: 900px) {
  .github-RecentCommits {
    max-height: 171px;
  }
}
@media (min-height: 1200px) {
  .github-RecentCommits {
    max-height: 326px;
  }
}
